class ddedePoopExtension {
    getInfo() {
        return {
            id: 'poopextensionruby',
            name: 'Poop Extension',
            color1: getRandomHexColor(),
            color2: getRandomHexColor(),
            color3: getRandomHexColor(),
            blocks: [
                {
                    opcode: 'poopyReporter',
                    blockType: Scratch.BlockType.REPORTER,
                    text: 'poop',
                    color1: getRandomHexColor()
                },
                {
                    opcode: 'genericPlatformer',
                    blockType: Scratch.BlockType.COMMAND,
                    text: 'create generic platformer project',
                    color1: getRandomHexColor()
                },
                {
                    opcode: 'gettingOverIt',
                    blockType: Scratch.BlockType.COMMAND,
                    text: 'create getting over it project by griffpatch',
                    color1: getRandomHexColor()
                },
                {
                    opcode: 'comicSans',
                    blockType: Scratch.BlockType.COMMAND,
                    text: 'turn everything into comic sans',
                    color1: getRandomHexColor()
                }
            ]
        };
    }

    poopyReporter() {
        return '';
    }

    genericPlatformer() {
        Scratch.vm.loadProject(genericPlatformerLol);
    }

    gettingOverIt() {
        Scratch.vm.loadProject(gettingOverItProject);
    }

    comicSans() {
        var textElements = document.querySelectorAll("p, h1, h2, h3, h4, h5, h6, span, div, li, td, th, a");

        textElements.forEach(function (element) {
            element.style.fontFamily = "Comic Sans MS, sans-serif, Arial";
            element.style.fontWeight = "900";
        });
    }
}

Scratch.extensions.register(new ddedePoopExtension());